import React from "react";
import { useNavigate } from "react-router-dom";
import { useParams } from "react-router-dom";

function AllpostPage({ posts, logedinUser }) {
  const nav = useNavigate();
  const { id } = useParams();

  function openPost(id) {
    nav("/singlepost" + id);
    console.log("test");
  }

  return (
    <div className="posts">
      {posts.map((x, i) => (
        <div onClick={() => openPost(x.id)} key={i} className="singlepost">
          <img src={x.image} alt="" />
          <div>{x.title}</div>
          <div>{x.location}</div>
          <div>{logedinUser.email}</div>
        </div>
      ))}
    </div>
  );
}

export default AllpostPage;
